import { Link, NavLink } from 'react-router-dom';


function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-transparent">
            <div>
                <NavLink to="/" ><img width="30" height="24" src="https://res.cloudinary.com/getapet/image/upload/v1617641641/Logo_get_a_pet_qgclol.png" alt="getapet"/></NavLink>
            </div>
        </nav>
    );
}

export default Navbar
